import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FaHome, FaArrowLeft } from 'react-icons/fa'; // เพิ่มการ import FaArrowLeft และ FaHome

const Register = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    username: '',
    password: '',
    confirmPassword: '',
    email: '',
    faculty: '',
    major: '',
    year: '' // เพิ่มชั้นปี
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (formData.password !== formData.confirmPassword) {
      setError('รหัสผ่านไม่ตรงกัน');
      return;
    }

    console.log('ข้อมูลที่สมัคร:', formData);
    setError('');
    alert('สมัครสมาชิกสำเร็จ!');
  };

  return (
    <>
      <div style={styles.container}>
        {/* ปุ่มมุมซ้ายบน */}
        <div style={styles.topLeft}>
          <Link to="/" style={styles.linkButton}>
            <FaArrowLeft size={40} />
          </Link>
        </div>

        {/* ปุ่มมุมขวาบน */}
        <div style={styles.topRight}>
          <Link to="/" style={styles.linkButton}>
            <FaHome size={40} />
          </Link>
        </div>

        {/* ฟอร์มสมัครสมาชิก */}
        <form onSubmit={handleSubmit} style={styles.form}>
          <h2>ยืนยันข้อมูล</h2>

          {/* ชื่อจริงและนามสกุลอยู่ในช่องเดียวกัน */}
          <input
            type="text"
            name="firstName"
            placeholder="ชื่อจริง"
            value={formData.firstName}
            onChange={handleChange}
            required
            style={styles.input}
          />
          <input
            type="text"
            name="lastName"
            placeholder="นามสกุล"
            value={formData.lastName}
            onChange={handleChange}
            required
            style={styles.input}
          />

          {/* Input สำหรับอีเมล */}
          <input
            type="email"
            name="email"
            placeholder="อีเมล"
            value={formData.email}
            onChange={handleChange}
            required
            style={styles.input}
          />

          {/* Input สำหรับคณะ */}
          <input
            type="text"
            name="faculty"
            placeholder="คณะ"
            value={formData.faculty}
            onChange={handleChange}
            required
            style={styles.input}
          />

          {/* Input สำหรับสาขา */}
          <input
            type="text"
            name="major"
            placeholder="สาขา"
            value={formData.major}
            onChange={handleChange}
            required
            style={styles.input}
          />

          {/* Input สำหรับชั้นปี */}
          <input
            type="text"
            name="year"
            placeholder="ชั้นปี"
            value={formData.year}
            onChange={handleChange}
            required
            style={styles.input}
          />

          {/* แสดงข้อความ error ถ้ามี */}
          {error && <p style={styles.error}>{error}</p>}

          {/* ปุ่มสมัครสมาชิก */}
          <button type="submit" style={styles.button}>
            สร้างบัญชี
          </button>
        </form>
      </div>
    </>
  );
};

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    background: 'linear-gradient(to right, #fde9c9, #dbe9f4)',
    position: 'relative'
  },
  topLeft: {
    position: 'fixed',
    top: 20,
    left: 20,
    zIndex: 1,
  },
  topRight: {
    position: 'fixed',
    top: 20,
    right: 20,
    zIndex: 1,
  },
  linkButton: {
    textDecoration: 'none',
    color: 'black',
  },
  form: {
    backgroundColor: 'white',
    padding: '2rem',
    borderRadius: '10px',
    boxShadow: '0 5px 15px rgba(0,0,0,0.1)',
    width: '300px',
    textAlign: 'center'
  },
  input: {
    width: '48%', // ใช้ 48% เพื่อให้ช่องทั้งสองมีขนาดใกล้เคียงกัน
    padding: '10px',
    margin: '0.5rem 1%', // ใช้ระยะห่างระหว่างฟิลด์
    borderRadius: '5px',
    border: '1px solid #ccc',
    display: 'inline-block' // แสดงในบรรทัดเดียวกัน
  },
  button: {
    width: '100%',
    padding: '10px',
    backgroundColor: 'royalblue',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer'
  },
  error: {
    color: 'red',
    marginBottom: '10px',
    fontSize: '0.9rem'
  }
};

export default Register;
